function App() {
  return (
    <Router>
      <div className="font-sans antialiased text-gray-900 bg-gray-100">
        <main>
          {/* We will add a Navbar component here later */}
          <Routes>
            {/* We will uncomment these routes as we create the pages.
              For now, let's just have a placeholder.
            */}
            <Route path="/" element={
              <div className="min-h-screen flex items-center justify-center">
                <h1 className="text-4xl font-bold text-blue-600">LiveRestaurantMenu</h1>
              </div>
            } />
            {/* <Route path="/login" element={<LoginPage />} /> */}
            {/* <Route path="/register" element={<RegisterPage />} /> */}
            {/* <Route path="/dashboard" element={<DashboardPage />} /> */}
            {/* <Route path="/menu/:menuId" element={<PublicMenuPage />} /> */}
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
